    {
        if (($pfun = $_jm_obj_7_mup{$prop}))
        {
            # handle 7 mandatory props
            if (defined($pfun))
            {
                $must_count++;
                if (! &$pfun($pval, undef, $rep))
                {
                    return 0;
                }
            }
        }
        elsif (($pfun = $_jm_obj_7_map{$prop}))
        {
            # handle 8 may props
            if (defined($pfun) && ! &$pfun($pval, undef, $rep))
            {
                return 0;
            }
        }
        elsif (_jm_re_1($prop, $path, $rep))
        {
            # handle 1 re props
            # .'/^[Xx]_/'
            $res = 1;
            if (! $res)
            {
                return 0;
            }
        }
        else
        {
            return 0;
        }
    }
    if ($must_count != 7)
    {
        return 0;
    }
    return 1;
}

# check $ (.)
sub json_model_1($$$)
{
    my ($val, $path, $rep) = @_;
    my $res;
    # .
    $res = _jm_obj_7($val, $path, $rep);
    return $res;
}


